eqnarray:
\begin{eqnarray}
E_{\rm ct}[A,\Phi]  & = & \int d^3x \Biggl\{ 
-c_1\mbox{tr}\left(F_{i j}F_{i j}\right) 
+c_2\mbox{tr}\left(\left[D_{i}\Phi\right]^{\dag} D_{i}\Phi\right)
\nonumber \\ & & \hspace{1.5cm}
-c_3\left[\mbox{tr}\left(\Phi^{\dag}\Phi\right)-2v^2\right] 
-c_4\left[\mbox{tr}\left(\Phi^{\dag}\Phi\right)-2v^2\right]^2 \Biggr\} \, .
\

\begin{eqnarray}
m_w^2 & = & \left(m_w^{(0)}\right)^2
\Biggl[1+\frac{f^2}{8\pi^2} 
\Biggl\{\frac{2}{3}-\frac{m_w^2}{m_f^2}
\left(\frac{1}{6}-\int_0^1dx x^2(1-x)^2\frac{m_w^2}
{\Delta(x,m_w^2)}\right) 
\nonumber \\ && \hspace{3cm}
+6\int_0^1 dx x(1-x)\ln\frac{\Delta(x,m_h^2)}{m_f^2} 
-\int_0^1dx\ln\frac{\Delta(x,m_w^2)}{m_f^2} \Biggr\} \Biggr] \, ,
\label{ModelParamsConstraint}
\

\begin{eqnarray}
E_{\rm cl} & = & 4\pi \int_0^\infty dr 
\left\{ \frac{1}{g^2}\left[\rho^{\prime^2}
+ \rho^2(\theta^\prime  - a_1)^2 
+ \frac{(\rho^2-1)^2}{2r^2}  \right]  \right. 
\nonumber \\ &&\hspace{2cm} 
\left. +\frac{1}{f^2}\left[ r^2 \Sigma^{\prime 2 }
+ r^2\Sigma^2(\eta^\prime  - \frac{1}{2}a_1)^2 
+\frac{r^2}{4}m_h^2(\Sigma^2-1)^2  
 \right. \right.  \nonumber \\ && \hspace{3cm} 
\left. \left. + \frac{1}{2}\Sigma^2\left( (\rho - 1)^2 
+ 4\rho^2\sin^2\frac{\theta-2\eta}{2} \right) \right]\right\} \, ,
\label{eclchiral}
\

\begin{eqnarray}
\Phi & = & v(1-\xi)\mbox{{\sf 1}\mbox{\hspace*{-0.16em}}\rule{0.04em}{1.55ex}\mbox{\hspace*{0.1em}}} + \xi v U^{(1)} \, , \nonumber \\
A_j & = & \xi \frac{i}{g}U^{(1)}\partial_j{U^{(1)}}^{\dag} \, .
\label{linearpath1}
\

\begin{eqnarray}
A_\mu & = & h(r,\xi)\frac{i}{g} 
U_{\rm inst}(\vec{x},\xi)\partial_\mu 
U^{\dag}_{\rm inst}(\vec{x},\xi) \, , \nonumber \\
\Phi & = & v \sqrt{h(r,\xi)}\,U_{\rm inst}(\vec{x},\xi) \, ,
\label{definst1}
\

\begin{eqnarray}
c_1 & = & \frac{1}{6}\frac{g^2}{(4\pi)^2} \Biggl[ {\mathcal D} - \frac{1}{2} 
- 3\int_0^1dx x(1-x) \Biggl( 2\ln\frac{\Delta(x,m_w^2)}{m_f^2} 
%\nonumber \\ &&
- x(1-x)\frac{m_w^2}{\Delta(x,m_w^2)}  
\Biggr)  \Biggr] \, , \nonumber \\
c_2 & = & -\frac{f^2}{(4\pi)^2}\left[ {\mathcal D} - \frac{2}{3} - 
6\int_0^1 dx x(1-x)\ln \frac{\Delta(x,m_h^2)}{m_f^2} \right] \, , 
\nonumber \\
c_3 & = & 2m_f^2\frac{f^2}{(4\pi)^2}\left({\mathcal D}+1\right) \, , 
\nonumber \\
c_4 & = & \frac{f^4}{4(4\pi)^2}\left[ 4{\mathcal D} - \frac{m_h^2}{m_f^2} 
- 6\int_0^1dx\ln\frac{\Delta(x,m_h^2)}{m_f^2} \right] \, .
\

\begin{eqnarray}
E^{(1,2)} & = & 
\frac{-2}{(4\pi)^2}\int\frac{d^3q}{(2\pi)^3} 
\Biggl\{f^2\tilde{h}(\vec{q})\tilde{h}(-\vec{q}) 
\Biggl[ -(q^2+m_h^2) + 6\int_0^1 dx \Delta(x,-q^2)
\ln\frac{\Delta(x,-q^2)}{\Delta(x,m_h^2)} \Biggr]
\nonumber \\ && \hspace{2cm}
- m_f^2 \tilde{p}^a(\vec{q})\tilde{p}^a(-\vec{q}) 
\Biggl[q^2-6q^2\int_0^1 dx x(1-x) 
\ln\frac{\Delta(x,-q^2)}{\Delta(x,m_h^2)} 
\nonumber \\ && \hspace{7cm}
-2m_f^2\int_0^1 dx \ln\frac{\Delta(x,-q^2)}{m_f^2} \Biggr]  
\nonumber \\ & & \hspace{1cm}
+\frac{g^2}{2}\mbox{tr}\left(\vec{q}\cdot\vec{\tilde{A}}(\vec{q})\vec{q}
\cdot\vec{\tilde{A}}(-\vec{q})  \right) 
\Biggl[\frac{1}{6} - 
2\int_0^1 dx x(1-x)\ln\frac{\Delta(x,-q^2)}{\Delta(x,m_w^2)}  
\nonumber \\ &&\hspace{7cm}
-\int_0^1 dx x^2(1-x)^2\frac{m_w^2}{\Delta(x,m_w^2)} \Biggr] 
\nonumber \\ & & \hspace{1cm}
+\frac{g^2}{2}\mbox{tr}\left(\vec{\tilde{A}}(\vec{q})
\cdot\vec{\tilde{A}}(-\vec{q})\right)
\Biggl[-\frac{q^2}{6} - \frac{2}{3}m_f^2 
+ 2q^2\int_0^1 dx x(1-x)\ln\frac{\Delta(x,-q^2)}{\Delta(x,m_w^2)}  
\nonumber \\ & & \hspace{4cm}
+q^2\int_0^1 dx x^2(1-x)^2\frac{m_w^2}{\Delta(x,m_w^2)} 
+ m_f^2\int_0^1 dx \ln\frac{\Delta(x,-q^2)}{\Delta(x,m_h^2)}  
\nonumber \\ & & \hspace{4cm}
-5m_f^2\int_0^1 dx x(1-x)\ln\frac{\Delta(x,m_h^2)}{m_f^2} \Biggr] 
\nonumber \\ & & \hspace{1cm}
-igm_f^2\vec{q}\cdot\vec{\tilde{A}}^a(\vec{q})\tilde{p}^a(-\vec{q}) 
\Biggl[-\frac{2}{3}
+\int_0^1 dx \ln\frac{\Delta(x,-q^2)}{m_f^2}  
\nonumber \\ & & \hspace{5cm}
-6\int_0^1 dx x(1-x)\ln\frac{\Delta(x,m_h^2)}{m_f^2} \Biggr] \Biggr\} \, ,
\

\begin{eqnarray}
E^{(3,4)} & = & \int \frac{d^3 x}{(4\pi)^2}\, \mbox{tr}\, \Biggl\{ 
\frac{g^3}{6}\left(4i\partial_iA_j + g[A_i,A_j]\right)[A_j,A_i] 
\Biggl[\frac{1}{2} + 6\int_0^1 dx x(1-x)\ln\frac{\Delta(x,m_w^2)}{m_f^2}  
\nonumber \\ &&\hspace{7cm}
-3\int_0^1 dx x^2(1-x)^2\frac{m_w^2}{\Delta(x,m_w^2)}\Biggr] 
\nonumber\\ & & \hspace{1cm}
-g\vec{A}\cdot\left[g\vec{A}\left(\phi\phi^\dag+2vh\right)  
+ 2i\left(\vec{\partial}\phi\right)\phi^\dag \right]
\Biggl[-\frac{2}{3} 
-6\int_0^1 dx x(1-x)\ln\frac{\Delta(x,m_h^2)}{m_f^2}\Biggr]
\nonumber\\ &&\hspace{3cm}
+ f^4 \left( \phi\phi^\dag+ 4vh \right)
\phi\phi^\dag \Biggl[\frac{m_h^2}{4m_f^2}           
+ \frac{3}{2}\int_0^1 dx \ln\frac{\Delta(x,m_h^2)}{m_f^2}\Biggr] 
\Biggr\} \, ,
\

