\delta^{(1)}(k)&=&-\Im \mbox{tr} \left(F^{(1)}(k,0)\right)\,,
\nonumber \\ 
\delta^{(2)}(k)&=&-\Im \mbox{tr} \left(F^{(2)}(k,0)-\frac{1}{2}
